INSERT INTO `dim_pattern` VALUES (100000,1,29,'Unisex Sunday Robe',12.50,'Buy the Unisex Sunday Robe sewing pattern from Merchant and Mills. Easy like Sunday morning, wrap up and settle in. This is a traditional unisex dressing gown with an inner tie, patch pockets and a shawl collar.','Light to medium weight laundered linen, cotton double gauze, Indian cotton, cotton voile or lawn, linen waffle and tencel/linen.','110 cm wide fabric: 3.65 - 4.9 m // 120 cm wide fabric: 3.6 - 4.6 m // 140 cm wide fabric: 2.95 - 4 m // 150 cm wide fabric: 2.95 - 4 m.','XXS - XXL','1.5 m of interfacing.','Instructions; A4/US letter print-at-home pattern (50 pages); A0 copy shop pattern (3 sheets).'),(100001,2,15,'The Maker\'s Atelier Unlined Raw-edged Coat',14.00,'Buy the Unlined Raw-edged Coat sewing pattern from The Maker\'s Atelier. A sophisticated pared-back coat with distinctive raw edges, dropped shoulders and patch pockets. Shown here in neoprene, scuba and felted and boiled wools.','Medium to heavy weight felted and boiled wools. Hi-tech synthetics, neoprene and bonded fabrics. This garment has raw or unfinished edges so ideally requires fabrics that do not fray. The edges can be finished with a zigzag stitch.','120 cm wide fabric: 2.7 - 3.1 m // 150 cm wide fabric: 2.3 m.','8 - 18 (approx. UK 8 - 16/18, based on our standardised size chart). Please also check the designer\'s size chart and finished garment measurements.','4 buttons.','Instructions; A4/US letter print-at-home pattern (36 pages); A0 copy shop pattern (3 sheets) // Layers: No // Projector file: No. Please note you must print all sizes to ensure no pieces or markings are lost.'),(100002,3,8,'Matchy Matchy Stash Pocket Tote',9.00,'The Stash Pocket Tote is a fully lined tote bag with an outside pocket and shoulder straps. It\'s the perfect scrap buster and looks great in a patchwork style or single fabric. This is a quick and satisfying sew that you will reach for again and again.','If using directional prints, keep in mind that they will be upside down on the back side of the tote as there is no bottom seam. // Main: Medium weight cotton, woven, twill, and canvas fabrics. // Lining: Lightweight cotton and woven fabrics.','44 inch (112 cm) wide fabric: Main, 0.75 yd (0.7 m) // Lining, 0.75 yd (0.7 m).','Finished tote measurements: H 15 inch (38 cm) x W 13 inch (33 cm) // Strap drop 12 inch (30.5 cm).','Fusible interfacing, 10 inch x 26 inch (25.5 cm x 66 cm).','Instructions; mood board for fabric planning; US letter/A4 print-at-home pattern (18 pages); A0 copy shop pattern (1 sheet) // Layers: No // Projector file: No.'),(100003,4,21,'Ogden Cami',11.50,'The neckline and armholes are finished with a partial lining for a beautiful, high end finish. It is probably the most popular pattern in the sewing community! // A matching girls\' version is available here.','Lightweight woven fabrics such as crepe, rayon challis, voile, and lightweight linen.','Extra fabric may be needed to match stripes/plaids. // Sizes 0 - 18: 45 inch (114 cm) wide fabric: 1.75 - 2 yd (1.6 - 1.8 m) // 54 inch (137 cm) wide fabric: 1.25 - 2 yd (1.1 - 1.8 m). // Sizes 14 - 30: 45 inch (114 cm) or 54 inch (137 cm) wide fabric: 2.2 - 2.4 yd (2 - 2.2 m).','S 0 - 18 with a C cup (approx. UK 8 - 20) or US','Coordinating thread; loop turner or safety pin.','Instructions; print-at-home pattern (14 pages for sizes 0-18, 21 pages for sizes 14-30); A0 copy shop pattern (1 sheet for sizes 0-18, 1 sheet for sizes 14-30).'),(100004,5,19,'LB Pullover',11.00,'The dropped shoulders enable the style to have ample room around the bicep while the sleeves are straight and slim, so you have the golden combination of comfort without being swamped in fabric, and the jumper still looks polished.','Almost anything! The pattern was designed with a low-medium stretch fabric in mind like sweatshirting, knitted jersey or ponte. However, it is cut with enough ease and a wide neck so it can also be made in a woven fabric and looks beautiful in linen. If you are making it in a woven fabric, it is advisable to cut the collar on the bias.','Sizes 6 - 20 // 115 cm (45 inch) wide fabric: 1.84 - 1.93 m (2.01 - 2.11 yd) // 140 cm (55 inch) wide fabric: 1.03 - 1.28 m (1.13 - 1.42 yd) // Sizes 16 - 28 // 115 cm (45 inch) wide fabric: 1.89 - 2.20 m (2.06 - 2.4 yd) // 150 cm (60 inch) wide fabric: 1.25 - 1.53 m (1.36 - 1.66 yd) // If cutting the collar on the bias (for woven fabric), increase quantity by 10 cm (0.10 yd). All calculations are based on a single lay. If you want to cut your fabric on the fold, increase quantity by 35 cm (0.4 yd).','UK 6 - 28 (approx. UK 6 - 30, based on our standardised size chart). Please also check the designer\'s size charts and finished garment measurements. // The PDF files are separated into two size ranges (6 - 20 and 16 - 28). Both sets of files are included in your purchase. Sizes 16/18/20 overlap between the size ranges so you can still grade up or down easily if you are on the edge of a size range.','','Instructions; A4/US letter print-at-home pattern (23 pages for sizes 6-20, 23 pages for sizes 16-28); A0 copy shop pattern (1 sheet for sizes 6-20, 2 sheets for sizes 16-28); US copy shop pattern (1 sheet for sizes 6-20, 2 sheets for sizes 16-28) // Layers: Yes (print-at-home only) // Projector file: No.'),(100005,5,23,'Zadie Jumpsuit',14.00,'The neck edge is finished with bias binding. // Note: A pattern expansion (sold separately) is available for the Zadie Jumpsuit. Use the Zadie Dress Expansion to make a wrap dress version of Zadie!','This pattern was designed especially for woven, medium weight fabrics like cotton and linen and would look great in fabric that has a draped quality like crepe, viscose twill or satin. It would also make up well in some heavier fabrics like drill and light weight denim. It is possible to make this in knit or stretch fabrics like jersey but the binding technique around the neck is tricky in a stretch fabric so be warned that would take the difficulty degree up a few notches.','For Option B (sleeveless), reduce consumption by 35 cm (0.4 yd) for all sizes. // 115 cm (45 inch) wide fabric: 2.75 - 4.40 m (3.00 - 4.80 yd). // 150 cm (60 inch) wide fabric: 2.25 - 3.56 m (2.46 - 3.90 yd).','UK 6 - 28 (approx. UK 6 - 30, based on our standardised size chart). Please also check the designer\'s size chart and finished garment measurements. // This pattern was drafted for the height of 170 cm (5\'7 inch) and a C bust cup. However, the pattern was sampled with models who had A, C and DD bust cups, and no fitting alterations were necessary for any of these cup sizes. // The model pictured is 5\'10 inch with a 34D bust. She is wearing a size 12 with 2 inch of length added to the legs at the hem. This was the only modification for her.','','Instructions; A4/US letter print-at-home pattern (42 pages for sizes 6-20, 55 pages for sizes 16-28); A0 copy shop pattern (3 sheets for sizes 6-20, 3 sheets for sizes 16-28); US copy shop pattern (2 sheets for sizes 6-20, 3 sheets for sizes 16-28) // Layers: Yes // Projector file: Yes.'),(100006,6,11,'Square Neck Top',14.00,'The Square Neck Top is a boxy, slightly cropped, dolman sleeved top with a square neckline. A great beginner sewing pattern, it includes pattern pieces to make the top from a knit or woven fabric, as well as front pieces drafted for an A/B cup or a C/D cup. // Note: This pattern is also available as part of the Perfect for Beginners: Sewing Pattern Bundle.','Knit version: Knit fabrics with at least 20% 4-way stretch are suitable. Cotton jersey, rib knits and lightweight french terry would be great. Sturdier knits are generally easier to work with, while drapier, thinner knits are a little more difficult. // Woven version: Woven fabrics including linen, cotton, rayon and silk. The fabric you choose will affect the look of your top. If you choose a drapey fabric like a rayon or silk, you will have a more blouse-like top. If you choose something like linen, it will have a more structured vibe.','45 inch (1.2 m) wide fabric: 1.33 - 1.88 yd (1.2 - 1.7 m) // 54-60 inch (1.4-1.5 m) wide fabric: 1 - 1.88 yd (0.9 - 1.7 m).','XS - 7X (approx. UK 6 - 34) with A/B and C/D cups. Please check the size chart and finished garment measurements. The pattern was drafted for a height of 5\'6 inch.','Matching thread; 1/2 yd (0.5 m) of lightweight fusible interfacing (if making the knit version, use knit fusible interfacing); stretch or ballpoint needle if making the knit version.','Instructions; print-at-home patterns (for knits and wovens and A/B and C/D cups, 16 pages for each fabric/cup combination); A0 copy shop pattern (3 sheets).'),(100007,7,11,'Ninni Culottes',11.00,'They have a generous amount of ease and handy side pockets. // Note: This pattern is also available as part of the Perfect for Beginners: Sewing Pattern Bundle.','Choose a light weight or medium weight, drapey knit or woven fabric. Knit fabrics such as velour, light weight sweatshirting, medium weight jersey or similar are all good options. For the woven version, choose a rayon, light cotton, linen or similar.','150 cm (60 inch) wide fabric: 160 - 215 cm (1 3/4 - 2 3/8 yd) // 115 cm (45 inch) wide fabric: 205 - 280 cm (2 1/4 - 3 yd). // The fabric requirements include a 5% allowance for shrinkage. Note that the fabric consumption may be greater for fabrics with a pattern and for fabrics that need to be cut in one direction.','EU 32 - 56 (approx. UK 4/6 - 28). Please check the size chart and finished garment measurements.','Fusible knit interfacing, 25 cm (1/4 yd); 3.5 cm (1 3/8 inch) elastic, your waist circumference // With thick fabrics: pocket bag fabric, 30 cm (3/8 yd).','Instructions; A4/US letter print-at-home pattern (32 pages); A0 copy shop pattern (2 sheets) // Layers: Yes // Projector file: Yes.'),(100008,1,24,'Hot Water Bottle Cover',0.00,'The Hot Water Bottle Cover is a free sewing pattern from Merchant and Mills. Make this classic hot water bottle cover lined or unlined, bagged out or bound.','Self: Linen, 7-12 oz. (237-414 gsm) denim, wool, corduroy, quilted jacquard and quilted cotton. // Lining (optional): Cotton voile, lightweight linen, cotton poplin, lightweight wool and slip linings.','80-150 cm (31 1/2 inch-60 inch) wide fabric: Self, 0.4 m (1/2 yd) // Lining (optional), 0.4 m (1/2 yd).','Finished measurements: Length 36 cm (14 1/4 inch) x Width 24 cm (9 1/2 inch).','Optional: contrast fabric for ties, 13 cm x 24 cm (5 1/4 inch x 9 1/2 inch); 1.7 m (2 yd) of 3.5 cm (1 1/2 inch) bias binding.','Instructions; A4/US letter print-at-home pattern (4 pages) // A0 copy shop pattern: No // Layers: No // Projector file: No.'),(100009,8,36,'Sandcastle Bucket Hat',0.00,'The Baby/Child/Adult Sandcastle Bucket Hat is a free sewing pattern from Waves and Wild. The Sandcastle Bucket Hat is a reversible bucket style hat with a wide brim for good sun protection. Or use a water-resistant fabric to make a wonderful rain hat! It\'s a fabulous pattern for the whole family all year round.','This pattern can be made from most light/medium weight woven (non-stretch) fabrics. Knit fabrics can also be used but will make the finished hat fit a half/one size larger. Different weights and types of fabric will yield different results. Popular choices are quilting weight cotton, poplin and cotton/Lycra jersey. Or you can use water-resistant fabric to make a rain hat!','Baby/child sizes: maximum of 30 cm inner fabric and 30 cm outer fabric. // Adult sizes: maximum of 40 cm inner fabric and 40 cm outer fabric.','Newborn-3 months - XL Adult. Please check the size chart.','Fusible interfacing (optional).','Instructions; A4/legal/letter print-at-home pattern (4 pages); A0 copy shop pattern (1 sheet); projector pattern. This pattern has layers so you can print just the sizes(s) you need.'),(100010,1,24,'Bucket Hat PDF',0.00,'The Bucket Hat is a free sewing pattern from Merchant and Mills. This classic lined bucket hat will keep the sunshine or rain at bay.','Self: Oilskin, dry oilskin, mid weight cotton canvas or drill, mid weight (8-14 oz.) denim, 5-10 oz. linen. // Lining: Cotton voile, calico or barrier lining.','All with or without nap. // Self - narrow brim: 80 cm wide fabric: 0.5 m // 100-150 cm wide fabric: 0.35 m. // Self - wide brim: 80 cm wide fabric: 0.7 m // 100-150 cm wide fabric: 0.5 m. // Lining: 80 cm wide fabric: 0.3 m // 100-150 cm wide fabric: 0.25 m.','M - XL','15 cm of interfacing (optional).','Instructions; A4/US letter print-at-home pattern (3 pages) // A0 copy shop pattern: No // Layers: No // Projector file: No.'),(100011,1,3,'Audrey Hooded Scarf',6.50,'Buy the Audrey Hooded Scarf sewing pattern from Merchant and Mills. Not a scarf but more than a hood! Audrey is a warm layer over a coat or a pop of colour over a dress. Make it with contrast or self lining.','Main: Mid-weight wool, double gauze, light to mid-weight corduroy and quilted jacquard (use a lightweight lining if using jacquard). // Lining: Cotton voile, lightweight linen, cotton poplin, lightweight wool, soft/ brushed cottons.','All with or without nap. // 110-120 cm (43 1/2 inch-47 inch) wide fabric: 0.8 m (1 yd) // 140-150 cm (55 inch-60 inch) wide fabric: 0.6 m (3/4 yd).','One size. Please check the designer\'s finished garment measurements.','','Instructions; A4/US letter print-at-home pattern (8 pages); A1 copy shop pattern (1 sheet) // Layers: No // Projector file: No.'),(100012,9,22,'Odessa Corset Top and Panty',0.00,'The Odessa Corset Top and Panty is a free sewing pattern from Madalynne. The pattern includes a corset-inspired top that can be worn as lingerie or as outer wear. It is finished with fold over elastic, channeling, and plastic boning. The front has functional hook and eye tape. The Odessa panty is a mid-rise thong finished with fold over elastic.','MAIN FABRIC: Fabric for all pieces. Pattern was designed to be made with fabrics that have 8-20% spandex. Recommended fabrics include stretch mesh, stretch all over lace, jersey, and lycra. // LINING FABRIC: Fabric for lining all pieces. Pattern was designed to be lined with stretch mesh or other similar stretch fabric. If you are full busted (D+ cup), recommended to use power net for Center Front Bodice and Side Front Bodice.','Corset Top (main + lining): XXS-XL, 1/2 yd // 2X-4X, 5/8 yd. // Panty (main + lining): XS-XL, 1/3 yd // 2X-4X, 1/2 yd.','XXS/XS','4.5 yd of fold over elastic, 3/8 inch (when folded) for sizes XXS-XL or 3/4 inch (when folded) for sizes 2X-4X; 1.25 yd of underwire channeling (optional); 1.25 yd of plastic boning (optional); 0.75 yd of hook and eye tape; swatch of cotton jersey for panty gusset // Optional: 28 mm rotary cutter; spray adhesive.','Step-by-step instructions; A4 print-at-home pattern (12 pages); US letter print-at-home pattern (12 pages); A0 copy shop pattern (1 sheet) // Layers: Yes // Projector file: No. Note: This pattern must be printed in colour. // Note: You might also be interested in the DIY kits Madalynne has created to accompany her patterns. These contain all the notions you need for your sewing project.'),(100013,7,2,'Kielo Wrap Dress and Jumpsuit',15.00,'There is a vent with a button closure at the back of the jumpsuit, and its neckline is finished with a facing.','For all variations, use a drapey but sturdy jersey that stretches about 30 - 50%. The garment has quite a bit of volume, so make sure your jersey isn\'t too stretchy and heavy, as it can lose its shape and change the proportions of the garment.','The fabric requirements include a 5% allowance for shrinkage. Note that the fabric consumption may be greater for fabrics with a pattern and for fabrics that need to be cut in one direction. // Sleeved Dress: 150 cm (60 inch) wide fabric: 200 - 320 cm (2 1/8 - 3 1/2 yd) // 115 cm (45 inch) wide fabric (sizes 32-50 only): 255 - 375 cm (2 3/4 - 4 1/8 yd). // Sleeveless Dress: 150 cm (60 inch) wide fabric: 155 - 315 cm (1 3/4 - 3 1/2 yd) // 115 cm (45 inch) wide fabric (sizes 32-50 only): 255 - 375 cm (2 3/4 - 4 1/8 yd). // Sleeved Jumpsuit: 150 cm (60 inch) wide fabric: 265 - 370 cm (2 7/8 - 4 yd) // 115 cm (45 inch) wide fabric: 340 - 530 cm (3 3/4 - 5 3/4 yd). // Sleeveless Jumpsuit: 150 cm (60 inch) wide fabric: 240 - 345 cm (2 5/8 - 3 3/4 yd) // 115 cm (45 inch) wide fabric: 310 - 530 cm (3 3/8 - 5 3/4 yd).','EU 32 - 56 (approx. UK 4/6 - 28). Please check the size chart and finished garment measurements. Choose your size according to the full bust measurement. The pattern is drafted for a 172 cm (5\'8 inch) tall person.','Dress: Fusible knit interfacing, 160 cm (1 3/4 yd); stay tape, 30 cm (12 inch) // Sleeveless Dress: Knit bias binding, 140 cm (1 1/2 yd) // Jumpsuit: Thin ribbon for button loop, 10 cm (4 inch); 1 small button // Sleeved Jumpsuit: Fusible knit interfacing, 160 cm (1 3/4 yd) // Sleeveless Jumpsuit: Fusible knit interfacing, 200 cm (2 1/4 yd).','Instructions; A4/US letter print-at-home pattern (54 pages); A0 copy shop pattern (3 sheets) // Layers: Yes // Projector file: Yes.'),(100014,10,24,'Kaia Dress and Top',11.00,'The central seams at the front and back are perfect for colour blocking and mixing contrast fabrics. Make Kaia in cotton or viscose for your everyday look, or go wild with clashing colours for a fun night out.','Light to medium weight woven fabrics such as cotton, viscose, tencel, crepe, rayon, linen and bamboo silk.','The fabric amount given is for directional prints. // 150 cm (60 inch) wide fabric: Midi dress, 1.5 - 2 m (1.7 - 2.2 yd) // Mini dress, 1.3 - 1.7 m (1.4 - 1.9 yd) // Top, 1 - 1.4 m (1.1 - 1.6 yd). // 115 cm (45 inch) wide fabric: Midi dress, 3 m (3.3 yd) // Mini dress, 2.5 m (2.8 yd) // Top, 2 m (2.2 yd).','Sew L','1.5 - 2.5 cm wide elastic for dress with an elastic waistband (see chart).','Instructions; A4/US letter print-at-home pattern (36 pages); A0 copy shop pattern (2 sheets) // Layers: Yes // Projector file: No.'),(100015,4,30,'Marlo Sweater',13.00,'Buy the Marlo Sweater sewing pattern from True Bias. Marlo is an oversized sweater with a dropped shoulder, deep V-neck, wide bands and large buttons. View A is cropped length. View B has patch pockets and hits around mid thigh.','The main sweater can be sewn up in stretch or nonstretch fabric. The bindings require at least 20% stretch. You can use the same fabric for both or use a contrasting fabric for the bindings. Suggested fabrics include medium weight fabrics such as sweater knit, french terry, sweatshirting, polar fleece, rib knit and boucle.','The fabric requirements assume you are using the same fabric for the main sweater and bindings. If using a contrasting binding, source 3/4 yd and subtract it from the total. Extra fabric may be needed to match stripes/plaids. // Sizes 0 - 18: View A: 45 inch (114 cm) wide fabric (sizes 0-14 only): 2.5 yd (2.3 m) / 54 inch (137 cm) wide fabric: 2 - 2.5 yd (1.8 - 2.3 m) // View B: 45 inch (114 cm) wide fabric (sizes 0-14 only): 3 yd (2.7 m) / 54 inch (137 cm) wide fabric: 2.2 - 3 yd (2 - 2.7 m). // Sizes 14 - 30: 54 inch (137 cm) wide fabric: View A, 2.5 yd (2.3 m) // View B, 3 yd (2.7 m).','S 0 - 18 with a C cup (approx. UK 8 - 20) or US','The possibilities are endless. You can wear the Ilford as a jacket or shirt depending on the fabric you use. This is a fun, skill building pattern that you will want to make/wear again and again! This pattern is for everyone and looks great on all genders!','Instructions; print-at-home pattern (58 pages for sizes 0-18, 60 pages for sizes 14-30); A0 copy shop pattern (3 sheets for sizes 0-18, 3 sheets for sizes 14-30); US copy shop pattern (1 sheet for sizes 0-18, 1 sheet for sizes 14-30).'),(100016,11,38,'Toaster Sweaters',12.00,'The front hem falls just below the high hip. Sew it in a boiled wool knit, wool jersey or ponte for a more dressed up look. Sew it in a sweatshirt fleece (with stretch) or jersey knit for a more casual look.','Mid to heavy weight stretch fabrics with at least 20% horizontal stretch. // Version #1: Stretch sweatshirt fleece, stretch French terry, knit boiled wool, ponte, scuba. // Version #2: Stretch sweatshirt fleece, stretch French terry, wool jersey, thick cotton interlock or jersey knit, stretch woven wool, ponte.','Allow extra fabric if matching stripes or plaids or using border prints. // Sizes 00 - 20 // Version #1: 54 inch (137 cm) wide fabric: 1 5/8 - 2 yd (1.5 - 1.8 m) // 60 inch (152 cm) wide fabric: 1 1/4 - 1 7/8 yd (1.2 - 1.7 m). // Version #2: 54 inch/60 inch (137/152 cm) wide fabric: 1 1/2 - 1 7/8 yd (1.4 - 1.7 m). // Sizes 16 - 34 // Version #1: 54 inch (137 cm) wide fabric: 1 3/4 - 2 3/4 yd (1.6 - 2.5 m) // 60 inch (152 cm) wide fabric: 1 3/4 - 2 3/4 yd (1.6 - 2.5 m). // Version #2: 54 inch (137 cm) wide fabric: 1 5/8 - 2 1/2 yd (1.5 - 2.3 m) // 60 inch (152 cm) wide fabric: 1 5/8 - 1 7/8 yd (1.5 - 1.7 m).','00 - 20 and 16 - 34 (approx. UK 6 - 22 and UK 20 - 36/38, based on our standardised size chart). Please also check the designer\'s size charts and finished garment measurements. // Note: The size ranges have been drafted from different blocks. The standard size range (sizes 00 - 20) is fit on a base size 8 that is approximately 5\'6 inch - 5\'7 inch (168 - 170 cm) tall and grades very slightly in height. It is fit on a B/C cup. The curvy size range (sizes 16 - 34) is fit on a base size 24 that is approximately 5\'6 inch - 5\'7 inch (168 - 170 cm) tall and does not grade in height. Cup sizes may be offered for C/D, E/F and G/H depending on the style. There are differences between the curvy and standard sizes 16 - 20. The shoulders on the curvy sizes are narrower, the cups are fuller, and the tummy and hips are rounder than for the standard sizes.','Thread // Optional for Version #2: double-sided fusible knit tape for the neck and hem.','Instructions; US letter/A4 print-at-home pattern for Version #1 (29 pages for sizes 00-20, 36 pages for sizes 16-34); US letter/A4 print-at-home pattern for Version #2 (22 pages for sizes 00-20, 25 pages for sizes 16-34); US copy shop pattern for Version #1 (1 sheet for each size range); US copy shop pattern for Version #2 (1 sheet for each size range); A0 copy shop pattern for Version #1 (2 sheets for each size range); A0 copy shop pattern for Version #2 (1 sheet for sizes 00-20, 2 sheets for sizes 16-34) // Layers: Yes // Projector file: Yes.'),(100017,12,2,'Sewing pattern storage envelopes',5.00,'Buy exclusive sewing pattern storage envelopes from The Fold Line. These gusseted envelopes have been designed specifically to store your sewing patterns. The envelopes have plenty of room to store copy shop printed pattern sheets or cut out pattern pieces. On the front of the envelope there is space to write notes about the garment you have made including the pattern name, size you have cut out and any fitting or construction notes. // These sewing pattern storage envelopes are available to buy in the following format: // // - PAPER with gusset (next working day dispatch on orders and FREE UK delivery over GBP50) // Product features: // - Expanding gusset: the envelopes have a side, top and bottom gusset that make them ideal for multiple pattern sheets // - Size: 324 x 229mm (32.4 x 22.9cm) will easily fit A4 or folded A0 sheets of paper // - Easy expansion and closure: each envelope has a trapezium-shaped peel and seal flap // - Weight of paper: 140 gsm* // This item is fully recyclable. // // If you\'re looking for more maker inspiration, check out the latest sewing pattern reviews from the sewing community. We also have a sewing blog to keep you up to date with all the news from the world of sewing.','','','','',''),(100018,8,21,'Heyday Dungarees',8.00,'They are designed to be long and worn rolled at the ankle. // A matching pattern for babies and children is available here.','Medium weight woven fabric such as corduroy, denim or linen. Softer fabrics will create a more flattering garment than stiff/structured ones.','140 cm (55 inch) wide fabric: 160 - 320 cm (1 3/4 - 3 1/2 yd). // The yardage is calculated for fabrics with a directional pile or print. If your fabric does not have a direction then you may need less.','XXS - 5XL','Most options will not require interfacing. However, if you are using a thin/soft/open weave fabric then the designer recommends adding light interfacing to your straps and the tops of the front and back bibs.','Instructions; A4/legal/letter print-at-home pattern (35 pages); A0 copy shop pattern (2 sheets); projector pattern. This pattern has layers so you can print just the sizes(s) you need.'),(100019,6,33,'Patina Blouse',14.00,'The Designer Edit: Friday Pattern Company Bundle.','Light to mid weight woven fabrics.','You may need to purchase extra yardage if your fabric has a heavy nap, is directional, striped, or has an obvious repeat. // Long sleeve: 45 inch (114 cm) wide fabric: 2.2 - 3.3 yd (2 - 3 m) // 54 inch-60 inch (137-162 cm) wide fabric: 1.9 - 2.7 yd (1.7 - 2.5 m). // Short sleeve: 45 inch (114 cm) wide fabric: 2 - 3.1 yd (1.8 - 2.8 m) // 54 inch-60 inch (137-162 cm) wide fabric: 1.7 - 2.5 yd (1.6 - 2.3 m).','XS - 7X (approx. UK 6 - 34, based on our standardised size chart). Please also check the designer\'s size chart and finished garment measurements. // The Patina Blouse is loose without being oversized. The sleeves are full so there is a lot of room through the biceps and shoulder area. If your chest, waist, and hips fall into different sizes you may want to blend between multiple sizes to get your perfect fit. The pattern was drafted for a height of 5\'6 inch (168 cm) and a B-cup bra size.','1/2 inch (1.3 cm) buttons, 5 if you are making the short sleeved version or 7 if you are making the long sleeved version; 0.7 yd (0.6 m) light to mid weight interfacing; matching thread.','Instructions; US letter/A4 print-at-home pattern (34 pages for blouse, 12 pages for lower neckline option); A0 copy shop pattern (3 sheets). This pattern has layers so you can print just the size(s) you need.'),(100020,6,12,'Donny Shirt',14.00,'The Donny is a great everyday top that can be worn with practically anything. Pair it with jeans or a skirt, layer it over or under a dress - the sky\'s the limit!','The Donny Shirt is designed for woven fabrics. Any light to medium weight woven is suitable. If you choose a fabric like a mid-weight twill or denim, you will get a more structured top. If you choose a drapier fabric like a rayon challis or silk, you will get a blousier top. // The green photo shoot sample is made from a 6 oz. linen. The white photo shoot sample is made from a 4.5 oz. silk noil.','You may need to purchase extra yardage if your fabric has a heavy nap, is directional, striped, or has an obvious repeat. // 45 inch (114 cm) wide fabric: 1.4 - 2.2 yd (1.3 - 2 m) // 54-60 inch (137-153 cm) wide fabric: 1.2 - 1.9 yd (1.1 - 1.7 m).','XS - 7X (approx. UK 6 - 34, based on our standardised size chart). Please also check the designer\'s size chart and finished garment measurements. // The pattern was drafted using sample measurements for a height of 5\'6 inch (168 cm) and a B-cup bra size.','1/2 yd (0.45 m) of 45 inch (114 cm) wide fusible interfacing.','Instructions; US letter/A4 print-at-home pattern (23 pages); A0 copy shop pattern (1 sheet) // Layers: Yes // Projector file: Yes.'),(100021,13,22,'Xenia Top',0.00,'The Xenia Top is a free sewing pattern from JULIANA MARTEJEVS. Xenia is a basic knit top with a straight neckline, wide straps and two length options. This summer essential can be dressed up or down for any occasion.','Cotton jersey.','140 cm (1.5 yd) wide fabric: Cropped length, 45 cm (18 inch) // Standard length, 75 cm (30 inch).','XS - XXXL','','Instructions in German and English with a link to a step-by-step video tutorial (in German with English subtitles); A4 print-at-home pattern (12 pages); US letter print-at-home pattern (12 pages); A1 copy shop pattern (1 sheet) // Layers: No // Projector file: No.'),(100022,14,25,'Anthea Blouse 