s 14-34, 1 sheet for gathered sleeve) // Layers: Yes // Projector file: Yes.'),(100030,14,21,'Pomona Pants and Shorts',12.00,'The waistband is created by folding over the top edge of the pants, which eliminates the extra bulk you would get from a separate waistband seam. View A is a wide leg, ankle length sailor pant with one patch pocket on the back. View B is a loose tapered leg, ankle length pant, also with one patch pocket on the back. View C is the shorts version of View A, with a 5 inch inseam and two patch pockets on the front. This design was drafted for woven non-stretch fabrics.','8 - 10 oz cotton canvas or twill fabric with no stretch. Other woven fabrics can be used, including medium to heavy weight linen (5 - 6 oz), silk or wool suiting. This pattern is intended to be used with non-stretch fabrics. However, it will work for woven fabrics with a little stretch as well.','Extra fabric needed to match plaids, stripes or one-way designs. // Views A and B: 45 inch (114 cm) wide fabric: 3 yd (2.7 m) // 60 inch (152 cm) wide fabric: 1 3/4 - 3 yd (1.6 - 2.7 m). // View C: 45 inch (114 cm) wide fabric: 1 3/4 yd (1.6 m) // 60 inch (152 cm) wide fabric: 1 1/4 - 1 3/4 yd (1.2 - 1.6 m).','00 - 22 (approx. UK 6 - 22). Please check the size chart and finished garment measurements.','Thread; 2 inch wide waistband elastic, 25 inch - 42 inch long.','Instructions; US letter/A4 print-at-home pattern (57 pages); US copy shop pattern (1 sheet); A0 copy shop pattern (3 sheets).'),(100031,16,9,'Fringe Dress and Blouse',14.50,'Buy the Fringe Dress and Blouse sewing pattern from Chalk and Notch. Fringe is a woven dress and blouse with two views. View A has a button up front, elbow sleeve and sleeve tab. View B has a pullover, notched front with a cuff. Both views include two cup sizes and optional waist ties, and the sleeve/cuffs are interchangeable. // A matching children\'s version is available here.','This style is designed for a light to medium weight woven fabric with a nice drape, such as rayon challis, rayon crepe, rayon voile, cotton lawn, cotton voile, cotton shirting, linen, double gauze.','Minimum fabric required is listed. If you think you will need more for shrinkage, directional print, pattern matching or print repeat, please purchase accordingly. // Blouse: 44 inch (112 cm) wide fabric: 2 - 3 yd (1.8 - 2.7 m) // 54 inch (137 cm) wide fabric: 1 1/2 - 2 1/4 yd (1.4 - 2.1 m). // Dress: 44 inch (112 cm) wide fabric: 2 3/4 - 4 yd (2.5 - 3.7 m) // 54 inch (137 cm) wide fabric: 2 - 3 1/4 yd (1.8 - 3 m).','US 0 - 30 (approx. UK 8 - 30, based on our standardised size chart) with A/B and C/D bust cup options. Please also check the designer\'s size chart and finished garment measurements. // Use the high bust and full bust measurements to determine your size. If you fall between sizes, size down. It is always recommended to sew a test garment to confirm fit. // This pattern includes two bust cup options, and the cup size is determined by calculating the difference between the high and full bust. If the difference between your high bust and full bust is between 0 inch and 2 inch (5 cm) use the A/B cup. If the difference is between 2 inch (5 cm) and 4 inch (10 cm) use the C/D cup. If you have more than a 4 inch (10 cm) difference, you may need a full bust adjustment.','1/2 yd (0.4 m) of tricot fusible interfacing; five 1/2 inch (12.7 mm) buttons for View A // Optional: safety pin or turning tool.','Step-by-step illustrated instructions; US letter/A4 print-at-home pattern (77 pages); US copy shop pattern (36 inch x 155 inch); A0 copy shop pattern (4 sheets) // Layers: Yes // Projector file: Yes.'),(100032,17,18,'Sicily Slip Dress',12.00,'The pattern comes with two views. View A has skinny straps, a low cowl neck and a midi-length. View B has wider straps, a higher cowl neckline and the hem falls above the knee.','Lightweight fabrics with a beautiful drape are best suited for this pattern: satins (silk, viscose or polyester), lightweight crepes, rayon/viscose, chiffon, charmeuse.','150 cm (59 inch) wide fabric: View A: 175 - 220 cm (2 - 2.4 yd) // View B: 160 - 205 cm (1.8 - 2.3 yd). // If you work with patterned fabric, you might need more fabric to pattern match.','A - J (approx. UK 6/8 - 28). Please check the size chart and finished garment measurements.','Thread; loop turner.','Step-by-step illustrated instructions; A4 print-at-home pattern (50 pages for View A, 46 pages for View B); A0 copy shop pattern (3 sheets for View A, 3 sheets for View B).'),(100033,11,4,'Free Range Slacks',13.50,'The tapered legs look great rolled up so the finished garment measurements show rolled and unrolled measurements and the instructions include options for French and flat-fell leg seams.','Bottom weight fabrics that aren\'t too heavy such as linen, cotton/linen blends, cotton twill, rayon/linen blends, light to mid-weight denim, tencel twill, cotton poplin, wool gabardine.','Allow extra fabric if matching stripes, plaids or using border prints. // Sizes 00 - 20: 44 inch (112 cm) wide fabric: 2 3/8 - 3 1/4 yd (2.2 - 3 m) // 54 inch (137 cm) wide fabric: 2 1/4 - 2 5/8 yd (2.1 - 2.4 m) // 60 inch (152 cm) wide fabric: 1 3/4 - 2 5/8 yd (1.6 - 2.4 m). // Sizes 18 - 34: 44 inch (112 cm) wide fabric: 3 1/8 - 5 yd (2.9 - 4.6 m) // 54 inch (137 cm) wide fabric: 2 5/8 - 3 1/8 yd (2.4 - 2.9 m) // 60 inch (152 cm) wide fabric: 2 7/8 - 3 1/8 yd (2.6 - 2.9 m).','00 - 20 (approx. UK 6 - 22) and 18 - 34 (approx. UK 20/22 - 38). Please check the size charts and finished garment measurements. If you are between sizes, consider sizing down. // Note: The size ranges have been drafted from different blocks. The standard size range (sizes 00 - 20) is fit on a base size 8 that is approximately 5\'6 inch - 5\'7 inch (168 - 170 cm) tall and grades very slightly in height. It is fit on a B/C cup. The curvy size range (sizes 18 - 34) is fit on a base size 24 that is approximately 5\'6 inch - 5\'7 inch (168 - 170 cm) tall and does not grade in height. Cup sizes may be offered for C/D, E/F and G/H depending on the style. There are differences between the curvy and standard sizes 18 and 20. The shoulders on the curvy sizes are narrower, the cups are fuller, and the tummy and hips are rounder than for the standard sizes.','Thread; 1 1/2 inch/40 mm wide elastic (length = your waist measurement + 1/2 inch/13 mm).','Instructions; US letter/A4 print-at-home pattern (54 pages for sizes 00-20, 40 pages for sizes 18-34 Version #1, 44 pages for sizes 18-34 Version #2); US copy shop pattern (1 sheet for sizes 00-20, 1 sheet for sizes 18-34 Version #1, 1 sheet for sizes 18-34 Version #2); A0 copy shop pattern (3 sheets for sizes 00-20, 2 sheets for sizes 18-34 Version #1, 2 sheets for sizes 18-34 Version #2) // Layers: Yes // Projector file: Yes.'),(100034,18,25,'Sofia Dress and Top',13.00,'Sofia is a wonderful mix of pretty and comfortable, featuring an elasticised, shirred bodice that allows for easy fit and wear. You will find full instructions on how to sew shirring. Choose from three garment styles along with several sleeve options, which can be mixed and matched to create different looks. // The dress features a waist-length bodice and an A-line skirt with optional pockets and lining. Two top options are also included, allowing you to make a crop with a small ruffle hem, or a peplum top with a larger ruffle hem. Pair them with your favorite high waisted skirt or pants. // Choose from four sleeve styles. Sleeves 1 and 2 are similar in style, featuring an elasticated puff shoulder and ruffled hem. Sleeve 1 is cap length, and Sleeve 2 is elbow length. Sleeve 3 is a bishop sleeve with an elasticated puff shoulder and rows of shirring at the wrist. Sleeve 4 is a bias-cut bell sleeve that is accompanied by a shoulder strap, designed to ensure coverage of bra straps.','Main: Lightweight fabric with a soft drape. Cotton, gingham, broadcloth, rayon, linen, single gauze, crepe. // Lining (optional): Bemberg or acetate lining. Select a colour that is compatible with your fabric.','The pattern is drafted for a height of 5\'7 inch (170 cm). Purchase additional fabric if lengthening your garment or if using fabric with a nap, directional print, stripes or plaids. // Sizes 0 - 18 // Dress: 45 inch (114 cm) wide fabric (sizes 0-12 only): 3.6 - 4.2 yd (3.3 - 3.8 m) // 54 inch (137 cm) wide fabric: 3.5 - 3.9 yd (3.2 - 3.6 m) // Optional skirt lining (54 inch/137 cm wide): 2 yd (1.9 m). // Crop Top: 45 inch (114 cm) wide fabric (sizes 0-12 only): 1.8 - 2.4 yd (1.6 - 2.1 m) // 54 inch (137 cm) wide fabric: 1.6 - 2 yd (1.5 - 1.8 m). // Peplum Top: 45 inch (114 cm) wide fabric (sizes 0-12 only): 2 - 2.6 yd (1.8 - 2.4 m) // 54 inch (137 cm) wide fabric: 1.8 - 2.2 yd (1.7 - 2 m). // Sizes 14 - 30 // Dress: 54 inch (137 cm) wide fabric (sizes 14-24 only): 3.8 - 4.3 yd (3.5 - 3.8 m) // 60 inch (152 cm) wide fabric (sizes 26-30): 3.8 - 4.3 yd (3.5 - 3.9 m) // Optional skirt lining (54 inch/137 cm wide for sizes 14-24 or 60 inch/152 cm wide for sizes 26-30): 2 yd (1.9 m). // Crop Top: 54 inch (137 cm) wide fabric: 1.8 - 2.4 yd (1.7 - 2.2 m). // Peplum Top: 54 inch (137 cm) wide fabric: 2 - 2.7 yd (1.8 - 2.5 m).','0 - 18 (approx. UK 6 - 18) or 14 - 30 (approx. UK 16 - 32). Please check the size chart.','All-purpose thread; 2 - 3 spools of good quality elastic thread (20 m/spool) // Dress: 1/4 inch elastic, 2 - 3 yd (1.9 - 2.8 m) // Crop and Peplum Top: 1/4 inch elastic, 1.2 - 1.8 yd (1.1 - 1.7 m) // Sleeve 4 (bell): fusible interfacing, 1/2 yd/m.','Instructions; US letter/A4 print-at-home pattern (55 pages for sizes 0 - 18 or 65 pages for sizes 14 - 30 if printing all options); A0 copy shop pattern (3 sheets); 36 inch wide copy shop pattern.'),(100035,14,14,'Persephone Pants and Shorts',3.85,'They have a concealed button fly, front waist in-seam pockets, belt loops, and two back waist shaping darts. View A: Cropped length pants. View B: Cut-off shorts.','10 oz cotton canvas or twill fabric, or a bottom weight fabric like cotton denim or drill, with no stretch. Intended to be made with woven non-stretch fabrics, however 3%-5% stretch woven fabrics can also be used.','Extra fabric needed to match plaids, stripes, or one-way designs. // 45 inch (114 cm) wide fabric: Pants, 3 - 3 1/4 yd (2.7 - 3 m) // Shorts, 1 5/8 yd (1.5 m). // 60 inch (152 cm) wide fabric: Pants, 1 3/4 - 3 yd (1.6 - 2.7 m) // Shorts, 1 1/4 - 1 3/4 yd (1.2 - 1.6 m). // Pocket lining fabric (45 inch wide): 1/4 yd (0.2 m).','0 - 20 (approx. UK 8 - 20). Please check the size chart and finished garment measurements.','Matching thread; denim sewing machine needle; heavy duty button thread for hand sewing buttons; button fly: 5/8 inch buttons (four for sizes 0-16 or five for sizes 18-20); waistband button: one 3/4 inch or 7/8 inch button; 1/4 yd of 45 inch wide interfacing.','Instructions; US letter/A4 print-at-home pattern (48 pages); US copy shop pattern (1 sheet); A0 copy shop pattern (3 sheets). // A Zipper Expansion is also available for the Persephone Pants and Shorts pattern. The Zipper Expansion is a PDF download with instructions on how to install a zipper (instead of the included button fly). You will need to purchase the Persephone Pants and Shorts pattern to complete the zipper. There are no pattern pieces included in the expansion, as you will be using the pattern pieces included in the Persephone pattern. This expansion can also be used with Anna Allen\'s Philippa Pants. // PLEASE NOTE: The Zipper Expansion is a separate add-on priced at GBP4.10. You must buy the original Persephone Pants and Shorts pattern priced at GBP14.50 to use it.'),(100036,19,9,'Nepheline Blouse',15.30,'The D cup option has bust darts.','The Nepheline Blouse pattern is designed for woven fabrics. It works best for lightweight fabrics. Choose a lightweight fabric (2-4 oz/yd sq) such as cotton lawn, batiste, voile, silk crepe de chine, silk georgette. Midweight fabrics (5-6 oz/yd sq) will also work and create a sturdier blouse. Choose a cotton poplin or plain-woven linen. Keep in mind the ruffles will be less finely defined if using a midweight fabric.','Note you may need more yardage if you are working with graphic prints and wish to pattern match. You may need more yardage if you choose to lengthen the blouse bodice or sleeves. // B cup sizes: 56 inch (142 cm) wide fabric: 1.75 - 2 yd (1.6 - 1.8 m) // 44 inch (112 cm) wide fabric: 2 - 2.25 yd (1.8 - 2.1 m). // D cup sizes: 56 inch (142 cm) wide fabric: 2.25 - 2.5 yd (2.1 - 2.3 m) // 44 inch (112 cm) wide fabric: 2.75 - 3.75 yd (2.5 - 3.4 m).','1 - 9 / B cup and 5 - 14 / D cup (approx. UK 6 - 22 and UK 14/16 - 32/34, based on our standardised size chart). Please also check the designer\'s size chart and finished garment measurements. // B cup indicates a difference of 2 inch between the high bust and full bust. D cup indicates a difference of 4 inch between the high bust and full bust. The sizes of the B cup and D cup patterns are consistent for the shoulders and upper bust. The full bust is what differs between the two size ranges.','0.25 yd/m of interfacing for button plackets (choose a weight that is slightly lighter than your fabric); 3/8 inch-1/2 inch (10-12 mm) buttons, 7 for View A or 6 for View B (you may need more buttons if you change the spacing or lengthen the blouse).','Instructions; US letter/A4 print-at-home pattern (28 pages for B cup, 32 pages for D cup); US copy shop pattern (36 inch x 72 inch for B cup, 36 inch x 100 inch for D cup); A0 copy shop pattern (2 sheets for B cup, 2 sheets for D cup) // Layers: Yes // Projector file: No.'),(100037,4,26,'Shelby Dress and Romper',13.00,'The romper gives the illusion of being a dress with the coverage of a short or pant. View C is a mini length romper hitting mid-thigh, while View D\'s hem ends just above the ankle.','Lightweight woven fabrics with drape such as cotton, rayon challis, crepe, silk, voile and linen.','Extra fabric may be needed to match stripes/plaids or for directional prints. // Sizes 0 - 18 // Views A and C: 45 inch (114 cm) wide fabric: 3.2 - 3.7 yd (3 - 3.4 m) // 54 inch (137 cm) wide fabric: 2.5 - 3 yd (2.3 - 2.7 m). // Views B and D: 45 inch (114 cm) wide fabric: 5 - 5.5 yd (4.6 - 5 m) // 54 inch (137 cm) wide fabric: 4.3 - 4.7 yd (4 - 4.3 m). // Sizes 14 - 32 // Views A and C: 54 inch (137 cm) or wider fabric: 3 - 3.7 yd (2.7 - 3.4 m). // Views B and D: 54 inch (137 cm) or wider fabric: 5 - 5.5 yd (4.6 - 5 m).','S 0 - 18 or US','Coordinating thread; 2 yd of lightweight fusible interfacing; seven (sizes 0-18) or nine (sizes 14-32) 3/8 inch buttons for Views A and B; five (sizes 0-18) or six (sizes 14-32) 3/8 inch buttons for Views C and D.','Instructions; print-at-home pattern (84 pages for sizes 0-18, 104 pages for sizes 14-32); A0 copy shop pattern (4 sheets for sizes 0-18, 5 sheets for sizes 14-32); US copy shop pattern (1 sheet for sizes 0-18, 1 sheet for sizes 14-32).'),(100038,6,2,'Unisex Ilford Jacket',14.00,'The possibilities are endless. You can wear the Ilford as a jacket or shirt depending on the fabric you use. This is a fun, skill building pattern that you will want to make/wear again and again! This pattern is for everyone and looks great on all genders!','The Ilford Jacket is designed for wovens and can be made from a wide variety of fabrics. For a boxier look, go for a lightweight canvas, linen, denim, or corduroy. It also looks amazing in a drapey woven. When sewn up in a flannel, it is the perfect fall layering piece.','Yardage listed below includes 1/4 yd (0.2 m) for pockets. You may need to purchase extra yardage if your fabric has a heavy nap, is directional, striped, or has an obvious repeat. // Regular length jacket: // Sizes XS - 7X: 45 inch (114 cm) wide fabric: 2.25 - 3.5 yd (2.1 - 3.2 m) // 54 inch - 60 inch (137 - 152 cm) wide fabric: 1.75 - 2.75 yd (1.6 - 2.5 m). // Longer jacket: // Sizes XS - 7X: 45 inch (114 cm) wide fabric: 2.75 - 4.6 yd (2.5 - 4.2 m) // 54 inch - 60 inch (137 - 152 cm) wide fabric: 2.3 - 3.3 yd (2.1 - 3.0 m).','XS - 7X (approx. UK 6 - 34, based on our standardised size chart). Please also check the designer\'s size chart and finished garment measurements. // This pattern was drafted using sample measurements for a height of 5\'6 inch (168 cm) and a B-cup bust.','Matching thread; 5-12 buttons (any size is fine, but the designer recommends 1 inch-1.5 inch buttons); 1 yd (0.9 m) of 20 inch (51 cm) wide light to midweight fusible interfacing.','Instructions; US letter/A4 print-at-home patterns for the body (24 pages for XS-XXL, 30 pages for 1X-7X), placket sleeve (7 pages for XS-XXL, 8 pages for 1X-7X), boxy sleeve (6 pages for XS-XXL, 10 pages for 1X-7X) and pockets (11 pages); A0 copy shop pattern (3 sheets for XS-XXL, 3 sheets for 1X-7X). This pattern has layers so you can print just the size(s) you need.'),(100039,5,20,'Block Tee',11.00,'The neckline has a hidden binding to complement its minimalist design, and the hem turn ups are extra deep to emphasise its boxy silhouette.','The pattern was designed with a woven fabric like linen or cotton in mind, and it works equally well in something light and drapey like a crepe de chine or silk. However it could easily be made in a jersey or stretch fabric with some consideration taken into account for finishing techniques.','115 cm (45 inch) wide fabric: 1.25 - 2.3 m (1.37 - 2.55 yd) // 150 cm (60 inch) wide fabric: 1 - 1.55 m (1.09 - 1.7 yd).','UK 6 - 28 (approx. UK 6 - 30, based on our standardised size chart). Please also check the designer\'s size chart and finished garment measurements.','','Instructions; A4/US letter print-at-home pattern (23 pages); A0 copy shop pattern (1 sheet); US copy shop pattern (1 sheet) // Layers: Yes // Projector file: No.'),(100040,20,28,'Helen\'s Closet York Pinafore',13.00,'The York Pinafore is a modern take on a classic pinafore dress with a cocoon shape and two views. View A features large scoop pockets, a dipped neckline, and comes to the knee. View B is a shorter length with a high neckline and a kangaroo pocket.','Medium to heavy weight woven fabrics such as cotton twill, denim, wool, linen, corduroy, and canvas. Crisp lightweight fabrics such as cotton and lightweight linen can also be used for a warm-weather pinafore. Use drapier fabrics such as tencel twill, wool crepe, rayon crepe, or viscose poplin if you prefer a softer, less structured look.','View A (longer view): 57 inch (150 cm) wide fabric: 1.4 - 2.2 yd (1.2 - 2 m) // 45 inch (115 cm) wide fabric: 1.7 - 2.7 yd (1.5 - 2.5 m). // View B (shorter view): 57 inch (142 cm) wide fabric: 1.3 - 1.9 yd (1.1 - 1.7 m) // 45 inch (112 cm) wide fabric: 1.6 - 2.5 yd (1.4 - 2.2 m).','0 - 34 (approx. UK 6 - 34). Please check the size chart and finished garment measurements.','Thread; 4 yd/m of 1/2 inch (1.3 cm) wide double fold bias tape.','Instructions; US letter/A4 print-at-home pattern (33 pages); A0 copy shop pattern (2 sheets).'),(100041,21,7,'Jazz Jumpsuit, Dress and Top',17.00,'This e-book offers a whopping 80 variations mixing different bodices, bottoms and sleeve styles to create loose and comfortable jumpsuits, playsuits, dresses and tops! // Bodices (all with a button front option): // - Loose fitting dartless bodice with a V-neckline // - Close fitting bodice with darts and a U-neckline // - Overalls bib // Bottoms: // - Flared pants // - Straight pants // - Shorts // - Straight above the knee skirt // - Flared knee length skirt with a ruffle // - Peplum // Sleeves (for the dartless bodice): // - Bishop sleeve // - Short sleeve','Midweight polyester or wool crepe, rayon/tencel and linen blends. Choose a fluid, light and supple fabric.','It depends on which of the variations you choose! Details are included in the pattern.','EU 32 - 52 (approx. UK 6 - 22/24, based on our standardised size chart). Please also check the designer\'s size chart. // This pattern was drafted for a height of 165 cm and a B cup.','','Instructions; A4/US letter print-at-home pattern (267 pages for all options); A0 copy shop pattern (9 sheets, some with overlapping pieces) // Layers: Yes // Projector file: No. // Languages: French, English and Spanish.'),(100042,11,8,'Elemental Skirt',0.00,'The Elemental Pencil Skirt is a free sewing pattern from Sew House Seven. This high-waist knit skirt is quick and easy to make. The hidden elastic waistband creates comfort like pyjamas and provides a smooth outer finish. It has a sleek pencil shape that skims the body and tapers quite a bit at the hem. Wear your skirt with sneakers for a casual and sporty look or dress it up with heels or boots.','Medium weight knit fabrics with at least 40% horizontal stretch such as stretch French terry, stretch sweatshirt fleece and cotton lycra. Use a knit fabric with good stretch recovery.','Allow extra fabric if matching stripes or plaids or using border prints. // Version #1: 58 inch (147 cm) wide fabric: 1 - 2 1/8 yd (1 - 2 m). // Version #2: 58 inch (147 cm) wide fabric: 1 1/8 - 2 3/8 yd (1.1 - 2.2 m).','00 - 20 and 18 - 34 (approx. UK 6 - 22 and UK 22 - 36/38, based on our standardised size chart). Please also check the designer\'s size chart and finished garment measurements. // Note: The size ranges have been drafted from different blocks. The standard size range (sizes 00 - 20) is fit on a base size 8 that is approximately 5\'6 inch - 5\'7 inch (168 - 170 cm) tall and grades very slightly in height. The curvy size range (sizes 18 - 34) is fit on a base size 24 that is approximately 5\'6 inch - 5\'7 inch (168 - 170 cm) tall and does not grade in height. There are differences between the curvy and standard sizes 18 - 20. The tummy and hips are rounder for the curvy sizes than for the standard sizes.','Thread; 1 1/2 inch (3.8 cm) wide elastic (long enough to go around your waist + 1/2 inch/1.2 cm).','Instructions; A4/US letter print-at-home pattern (32 pages for sizes 00-20, 37 pages for sizes 18-34); US copy shop pattern (1 sheet for sizes 00-20, 1 sheet for sizes 18-34); A0 copy shop pattern (2 sheets for sizes 00-20, 2 sheets for sizes 18-34) // Layers: Yes // Projector file: Yes.'),(100043,22,35,'Pietra Pants and Shorts',20.50,'Part of the Rome Collection, the Pietra Pants and Shorts are the best of both worlds: a flat front, high-waisted silhouette with the comfort of an elastic waist in the back. Featuring lengthening panels in the front with slanted hip pockets and a hidden waist stay, you\'ll never want to take them off. // Choose between four leg styles: a wide leg in either a floor-skimming or cropped length (View A), a slim and tapered leg (View B), or gently flared shorts (View C).','This pattern can be made with a variety of fabrics depending on the desired effect. For a more defined shape, use structured wovens such as linen, chambray, or lightweight denim or twill (heavyweight wovens may create too much volume at the elastic waist). For a swishy, glamorous look, use rayon challis, tencel, or silk.','45 inch (1.14 m) wide fabric: View A (full length): Sizes 0-14 = 3.25 yd (3 m) / Sizes 16-20 = 3.5 yd (3.2 m) // View A (cropped): Sizes 0-14 = 3 yd (2.75 m) / Sizes 16-20 = 3.25 yd (3 m) // View B: Sizes 0-14 = 2.5 yd (2.25 m) / Sizes 16-20 = 3 yd (2.75 m) // View C: Sizes 0-8 = 1.5 yd (1.4 m) / Sizes 10-20 = 1.75 yd (1.6 m). // 58 inch (1.5 m) wide fabric: View A (full length): Sizes 0-14 = 2.5 yd (2.25 m) / Sizes 16-20 = 2.75 yd (2.5 m) // View A (cropped): Sizes 0-14 = 2.25 yd (2 m) / Sizes 16-20 = 2.5 yd (2.25 m) // View B: Sizes 0-8 = 2 yd (1.85 m) / Sizes 10-20 = 2.25 yd (2 m) // View C: Sizes 0-20 = 1.25 yd (1.15 m).','0 - 20 (approx. UK 6 - 20, based on our standardised size chart). Please also check the designer\'s size chart and finished garment measurements.','2 inch (50 mm) wide elastic (1 yd/0.9 m); lightweight non-stretch fusible interfacing (0.25 yd/m). // Note: This pattern is available in an expanded size range on the designer\'s website (PDF only).',''),(100044,5,14,'Olya Shirt and Dress',15.50,'There is also an optional belt pattern included to cinch the dress in at the waist if desired.','This pattern was designed for medium weight fabrics like cotton, linen and flannel, and light weight fabrics like crepe de chine, viscose or georgette. It would also make up well in some heavier fabrics like corduroy, drill and light weight denim. Knit or stretch fabrics like jersey are not recommended.','Shirt: 115 cm (45 inch) wide fabric: 1.94 - 2.75 m (2.12 - 3.01 yd) // 140 cm (55 inch) wide fabric: 1.52 - 2.35 m (1.66 - 2.56 yd). // For dress option: Increase the above fabric consumption by 80 cm (0.9 yd) for sizes 6 - 14 and 1 m (1.1 yd) for sizes 16 - 28.','UK 6 - 28 (approx. UK 6 - 30, based on our standardised size chart). Please also check the designer\'s size chart and finished garment measurements.','Interfacing.','Instructions; A4/US letter print-at-home patterns (31 pages for shirt, 43 pages for dress); A0 copy shop patterns (2 sheets for shirt, 3 sheets for dress); US copy shop patterns (2 sheets for shirt, 2 sheets for dress) // Layers: Yes // Projector file: No.'),(100045,5,17,'Agnes Pyjama Set',14.00,'The Agnes Pyjama Set is a relaxed loungewear suit that comes with the option of shorts or long trousers. The shorts/trousers are designed to sit high on your natural waist with an elasticated waistband and feature no side seam so are very simple and fast to sew. The shirt is very oversized with batwing sleeves and no waist definition. It has a convertible collar with a button up front and patch pockets.','This pattern was designed especially for woven, light to medium weight fabrics like cotton lawn, poplin, linen or ramie. It would work well in fabrics that are as light as a cotton voile or double gauze but would also look great as an outerwear set made in medium to heavy fabrics like cotton drill or canvas and even a soft denim.','All calculations are on a single lay. If you want to cut your fabric on the fold, increase consumption by 35 cm (0.4 yd) for all sizes. // Shirt: 115 cm (45 inch) wide fabric: 1.85 - 2.65 m (2.02 - 2.90 yd) // 150 cm (60 inch) wide fabric: 1.56 - 2.14 m (1.70 - 2.34 yd). // Shorts: 115 cm (45 inch) wide fabric: 0.96 - 1.14 m (1.05 - 1.25 yd) // 150 cm (60 inch) wide fabric: 0.51 - 1.08 m (0.56 - 1.18 yd). // Trousers: 115 cm (45 inch) wide fabric: 2.38 - 2.55 m (2.60 - 2.79 yd) // 150 cm (60 inch) wide fabric: 1.21 - 2.55 m (1.33 - 2.78 yd).','UK 6 - 28 (approx. UK 6 - 30, based on our standardised size chart). Please also check the designer\'s size chart and finished garment measurements. // This pattern was drafted for someone who is 170 cm (5\'7 inch) tall. // Paper Theory patterns generally have a very relaxed and oversized fit and bust cup size is not as important as total chest measurement. Many people who regularly make full bust adjustments or small bust adjustments for other pattern companies find they do not need to with Paper Theory patterns if they are within two cup sizes either up or down. As a rough guide, shirt sizes 6 - 18 are drafted for a C cup, and sizes 20 - 28 are drafted with a D cup in mind.','Thread; fusible interfacing; 32 mm (1 1/4 inch) wide elastic for the shorts/trousers; 5 buttons for the shirt, 24L (15 mm/5/8 inch) but slightly bigger or smaller would be fine.','Instructions; A4/US letter print-at-home pattern (59 pages); A0 copy shop pattern (4 sheets); US copy shop pattern (4 sheets) // Layers: Yes // Projector file: Yes.'),(100046,15,36,'Studio Tunic',13.95,'The other samples are a standard fit.','Mid-weight woven fabric. Some wonderful choices are mid-weight linen and chambray, cotton twill, Essex linen or light canvas, in solids or prints. The drape or hand of the fabric will significantly impact the look and fit of the final garment - softer fabrics like washed linen will fall gently for a relaxed, garden vibe, and more sturdy fabrics like light canvas or twill will enhance the oversized, utility look and the A-line silhouette. (If you choose a heavier weight fabric, you might want to use a lighter fabric for your facings to reduce bulk.) More confident sewists might choose a viscose-linen blend for a really luxurious texture.','45 inch (114 cm) wide fabric: Sizes 0 - 22, 2.75 yd (2.5 m) // Sizes 24 - 28, 3.1 yd (2.8 m) // Sizes 30 - 34, will not fit. // 54 inch (137 cm) wide fabric: Sizes 0 - 22, 2.2 yd (2 m) // Sizes 24 - 28, 2.7 yd (2.4 m) // Sizes 30 - 34, 2.7 yd (2.4 m).','US 0 - 34 (approx. UK 6/8 - 32/34, based on our standardised size chart). Please also check the designer\'s size chart and finished garment measurements. // The pattern is drafted for a height of 5\'5 inch (165 cm).','0.75 yd (0.7 m) of lightweight fusible interfacing, either woven or non-woven (based on 20 inch/0.5 m wide interfacing).','Step-by-step instructions; US letter/A4 print-at-home pattern (36 pages for 0-24, 45 pages for 22-34); A0 copy shop pattern (2 sheets for 0-24, 3 sheets for 22-34) // Layers: Yes // Projector file: No.'),(100047,23,4,'Peony Dress',14.00,'The Peony Dress is not designed to be closely fitted, but there are darts on the front and back of the bodice and skirt so you can easily adjust the fit to your liking. Both Views A and B have a sleeve frill. View A also has a skirt frill that falls just above the ankle, while View B finishes mid-thigh with no frill.','Fabrics with a bit of drape such as viscose, crepe, silk and cotton lawn will give a floaty silhouette. You can also use a fabric with more body such as a mid to lightweight denim, cord or cotton poplin for a more structured dress. // You can use your main dress fabric for the shoulder puffs. If you want a more dramatic puff, use a double layer of your fabric or add a layer of interfacing into your puff. If you are using a thick fabric, you may want to use a lighter weight fabric for the puffs as you may find it hard to gather.','If your print is directional, you may need additional fabric. The fabric requirements include the sleeve and hem frills. If you want to use a contrasting fabric for the frills, you will need 80 cm (31.5 inch) for the hem and 30 cm (12 inch) for the sleeve. // Sizes 6 - 14 // 140 cm (55 inch) wide fabric: View A, 3 m (3.3 yd) // View B, 2.2 m (2.4 yd). // 115 cm (45 inch) wide fabric: View A, 3.8 m (4.2 yd) // View B, 2.8 m (3.1 yd). // Sizes 16 - 22 // 140 cm (55 inch) wide fabric: View A, 3.5 m (3.8 yd) // View B, 2.5 m (2.7 yd). // 115 cm (45 inch) wide fabric: View A, 3.9 m (4.3 yd) // View B, 3.1 m (3.4 yd). // Sizes 24 - 30 // 140 cm (55 inch) wide fabric: View A, 3.9 m (4.3 yd) // View B, 2.8 m (3.1 yd). // 115 cm (45 inch) wide fabric: View A, N/A* // View B, 3.7 m (4 yd). // *The skirt frill cannot be cut out of 115 cm (45 inch) wide fabric in sizes 24 - 30.','UK 6 - 30 (approx. UK 6 - 28, based on our standardised size chart). Please also check the designer\'s size chart and finished garment measurements. // The pattern is drafted for a height of 167 cm (5\'6 inch) and a B cup.','25 cm (10 inch) of iron-on interfacing; 56 cm (22 inch) concealed zip.','Instructions; A4 print-at-home pattern (48 pages); A0 copy shop pattern (3 sheets) // Layers: Yes // Projector file: No.'),(100048,24,2,'Bakerloo Blouse and Dress',9.50,'The dress variation has a full gathered (and pocketed) skirt - grunge it up with tights and biker boots for the winter then drift around in breezy cotton lawn and sandals all summer. Wear the blouse on its own or under pinafores, dungarees and v-neck sweaters for statement layering.','Light to medium-weight wovens such as lawn, poplin, chambray, silk dupion, crepe, fine needlecord; any fabric with enough body to create the collar but not too much bulk to gather into the frill! Of course you could use a contrast fabric or even a readymade trim for the frill...','Sizes 6 - 20 // Blouse, long sleeve: 150 cm (60 inch) wide fabric: 1.9 - 2 m (2 1/8 - 2 1/4 yd) // 115 cm (44 inch) wide fabric: 2.7 m (3 yd). // Blouse, short sleeve: 150 cm (60 inch) wide 