 the fabric you use. This is a fun, skill building pattern that you will want to make/wear again and again! This pattern is for everyone and looks great on all genders!','The Ilford Jacket is designed for wovens and can be made from a wide variety of fabrics. For a boxier look, go for a lightweight canvas, linen, denim, or corduroy. It also looks amazing in a drapey woven. When sewn up in a flannel, it is the perfect fall layering piece.','Yardage listed below includes 1/4 yd (0.2 m) for pockets. You may need to purchase extra yardage if your fabric has a heavy nap, is directional, striped, or has an obvious repeat. // Regular length jacket: // Sizes XS - 7X: 45 inch (114 cm) wide fabric: 2.25 - 3.5 yd (2.1 - 3.2 m) // 54 inch - 60 inch (137 - 152 cm) wide fabric: 1.75 - 2.75 yd (1.6 - 2.5 m). // Longer jacket: // Sizes XS - 7X: 45 inch (114 cm) wide fabric: 2.75 - 4.6 yd (2.5 - 4.2 m) // 54 inch - 60 inch (137 - 152 cm) wide fabric: 2.3 - 3.3 yd (2.1 - 3.0 m).','XS - 7X (approx. UK 6 - 34, based on our standardised size chart). Please also check the designer\'s size chart and finished garment measurements. // This pattern was drafted using sample measurements for a height of 5\'6 inch (168 cm) and a B-cup bust.','Matching thread; 5-12 buttons (any size is fine, but the designer recommends 1 inch-1.5 inch buttons); 1 yd (0.9 m) of 20 inch (51 cm) wide light to midweight fusible interfacing.','Instructions; US letter/A4 print-at-home patterns for the body (24 pages for XS-XXL, 30 pages for 1X-7X), placket sleeve (7 pages for XS-XXL, 8 pages for 1X-7X), boxy sleeve (6 pages for XS-XXL, 10 pages for 1X-7X) and pockets (11 pages); A0 copy shop pattern (3 sheets for XS-XXL, 3 sheets for 1X-7X). This pattern has layers so you can print just the size(s) you need.'),(100103,35,14,'The Coat',0.00,'The Coat sewing pattern from The Savile Row Suit by Patrick Grant. // NOTE: This is not a complete pattern. The instructions are in the book The Savile Row Suit by Patrick Grant (sold separately here). You must own a copy of the book to make this pattern. // IMPORTANT: This pattern is in one men\'s size only. Our understanding is that Patrick Grant designed the patterns in the book in a single size to give readers the opportunity to try out making each garment following the instructions, testing out traditional tailoring techniques which can then be applied to real-life projects. The book focuses on the history, process and skills of tailoring. // If you have any queries about the book or pattern, please contact the publisher directly at hello@gestalten.com. // About the book: Savile Row is the home of bespoke tailoring. In this book, Patrick Grant, co-owner of Savile Row tailors Norton and Sons, describes the long-standing traditions of craftsmanship maintained in the workrooms of this quiet corner of London\'s Mayfair. He celebrates the extraordinary ecosystem, from the British weavers and cloth houses to the trimmings merchants, that allows Savile Row to flourish. Grant shines a light on the captivating story of Savile Row and the painstaking processes required to create a bespoke garment. This book details, for the first time, the complete methods of several of Savile Row\'s finest sewing tailors, providing a detailed step-by-step manual on how to hand-make a pair of trousers, waistcoat and coat in the Savile Row style, and a shirt in the style of one of Jermyn Street\'s finest shirt makers. Richly illustrated, it gives an insight into a highly discreet and rarefied world of craftsmanship. // Patrick Grant is the co-owner of Norton and Sons and the co-owner and director of Community Clothing. He won Menswear Designer of the Year at the 2010 British Fashion Awards and is best known as a judge on the BBC One show The Great British Sewing Bee.','','','','','A4 print-at-home pattern (20 pages); A0 copy shop pattern (1 sheet) // Layers: No (one size) // Projector file: No. The instructions are in the book The Savile Row Suit by Patrick Grant (sold separately here).'),(100104,35,3,'The Shirt',0.00,'The Shirt sewing pattern from The Savile Row Suit by Patrick Grant. // NOTE: This is not a complete pattern. The instructions are in the book The Savile Row Suit by Patrick Grant (sold separately here). You must own a copy of the book to make this pattern. // IMPORTANT: This pattern is in one men\'s size only. Our understanding is that Patrick Grant designed the patterns in the book in a single size to give readers the opportunity to try out making each garment following the instructions, testing out traditional tailoring techniques which can then be applied to real-life projects. The book focuses on the history, process and skills of tailoring. // If you have any queries about the book or pattern, please contact the publisher directly at hello@gestalten.com. // About the book: Savile Row is the home of bespoke tailoring. In this book, Patrick Grant, co-owner of Savile Row tailors Norton and Sons, describes the long-standing traditions of craftsmanship maintained in the workrooms of this quiet corner of London\'s Mayfair. He celebrates the extraordinary ecosystem, from the British weavers and cloth houses to the trimmings merchants, that allows Savile Row to flourish. Grant shines a light on the captivating story of Savile Row and the painstaking processes required to create a bespoke garment. This book details, for the first time, the complete methods of several of Savile Row\'s finest sewing tailors, providing a detailed step-by-step manual on how to hand-make a pair of trousers, waistcoat and coat in the Savile Row style, and a shirt in the style of one of Jermyn Street\'s finest shirt makers. Richly illustrated, it gives an insight into a highly discreet and rarefied world of craftsmanship. // Patrick Grant is the co-owner of Norton and Sons and the co-owner and director of Community Clothing. He won Menswear Designer of the Year at the 2010 British Fashion Awards and is best known as a judge on the BBC One