ain ribbon, twill tape or cording // Optional button fly: one button, approx. 1.3 cm (1/2 inch); interfacing, 0.3 m (0.4 yd).','Step-by-step instructions; US letter/A4 print-at-home pattern (28 pages); 36 inch wide roll feed copy shop pattern (1 sheet); A0 copy shop pattern (2 sheets) // Layers: Yes // Projector file: Yes.'),(100108,36,14,'Men\'s Belvedere Waistcoat',10.50,'The instructions and pattern pieces provide for two approaches: // 1. Create a tailored waistcoat complete with welt pockets, a fully canvased front and side seam vents. // 2. Sew a quick and easy waistcoat with no pockets and simplified construction techniques. // Both waistcoat projects are great scrap busters since it is easy to mix and match fabrics. // Sewing level: Intermediate','Light to medium weight suiting fabrics, including wool, linen or blends. You can also experiment with unconventional fabrics such as upholstery fabrics, corduroy, sturdy knit fabrics, canvas or denim. The same fabric can be used for the waistcoat lining and back, or lining material can be used.','115 cm (45 inch) wide fabric: Main fabric, 0.7 - 0.8 m (0.8 - 0.9 yd) // Lining, 2.0 m (2.2 yd). // 150 cm (60 inch) wide fabric: Main fabric, 0.7 m (0.8 yd) // Lining, 1.3 m (1.4 yd). // The fabric requirements assume the back is cut from the same fabric as the lining. If using contrast or main fabric for the back, use 0.6 m (0.7 yd) less lining material. Cut the back from 0.7 m (0.8 yd) contrast or main fabric.','XS - 4XL','Medium-weight fusible or sewn-in interfacing (51 cm/20 inch wide), 1.3 m (1.4 yd); five or six 1/2 inch - 5/8 inch buttons; optional pocketing fabric, 0.1 m (0.1 yd).','Step-by-step instructions; US letter/A4 print-at-home pattern (25 pages); 36 inch wide roll feed copy shop pattern (1 sheet); A0 copy shop pattern (2 sheets) // Layers: Yes // Projector file: Yes.'),(100109,4,27,'Men\'s Hudson Pant',13.00,'The urban fit of these pants leaves a bit of extra room around the hips, has a slightly dropped crotch, and then tapers into a skinnier leg. It has an elastic waist with a drawstring, front pockets, and a cuff at the ankle.','Medium to heavy weight knits such as french terry, ponte, and sweatshirt knit with a suggested stretch of 40%-75%.','54 inch (137 cm) wide fabric: 2 - 2.2 yd (1.8 - 2 m). Extra fabric may be needed for stripes, plaids, or other patterned fabrics.','Waist 28 inch - 42 inch. Please check the size chart and finished garment measurements.','Coordinating thread; 2 inch wide elastic (1 1/2 yd); 1/4 inch wide cording (2-3 yd); 2 inch x 1 inch scrap of fusible interfacing; ballpoint sewing needle.','Instructions; print-at-home pattern (25 pages); A0 copy shop pattern (2 sheets); US copy shop pattern (1 sheet).'),(100110,7,9,'Lahja Unisex Dressing Gown',15.00,'The longer version extends to midleg and has full-length sleeves. Both variations feature large patch pockets and a belt fastening.','Choose a non-stretch fabric. Depending on the desired look, choose a coarse fabric, for example natural linen, terry cloth, or honeycomb fabric or, for a lighter version, pick a drapey rayon or satin. The sample garments are made from stonewashed linen.','The fabric requirements include a 5% allowance for shrinkage. Note that the fabric consumption may be greater for fabrics with a pattern and for fabrics that need to be cut in one direction. // Short: 150 cm (60 inch) wide fabric: 260 - 305 cm (2 7/8 - 3 3/8 yd) // 115 cm (45 inch) wide fabric: 310 - 465 cm (3 3/8 - 5 1/8 yd). // Long: 150 cm (60 inch) wide fabric: 295 - 370 cm (3 1/4 - 4 yd) // 115 cm (45 inch) wide fabric: 375 - 545 cm (4 1/8 - 6 yd).','XS - XXL','Short: Fusible interfacing, 125 cm (1 3/8 yd) // Long: Fusible interfacing, 155 cm (1 3/4 yd).','Instructions; A4/US letter print-at-home pattern (54 pages); A0 copy shop pattern (3 sheets) // Layers: Yes // Projector file: Yes.'),(100111,1,15,'Men\'s Foreman Jacket',12.50,'It can be optionally topstitched in contrasting thread.','Dry oilskin, cott