ry of rubbing or shifting. Short athletic legs and a smooth elastic waistband create a streamlined silhouette that can be worn under everything from slim fit pants to gym shorts. // Sewing level: Confident beginner','Cotton, bamboo, or blended lightweight knit with (preferably) at least 4% spandex/elastane and four-way stretch. The knit you choose should have 60 - 70% stretch. For sporty, versatile trunks, choose a lighter weight knit. For thicker, cosier trunks, choose a heavier t-shirt weight knit. Avoid tissue weight knits as these will not be strong enough.','115 cm (45 inch) wide fabric: 0.8 - 1.0 m (0.9 - 1.1 yd) // 150 cm (60 inch) wide fabric: 0.6 m - 0.9 m (0.7 - 1.0 yd).','Waist 24 inch - 45 inch. Please check the designer\'s size chart and finished garment measurements.','Elastic waistband (1 1/2 inch - 1 3/4 inch wide).','Step-by-step instructions; US letter/A4 print-at-home pattern (8 pages for sizes 24-36, 10 pages for sizes 39-45); 36 inch wide roll feed copy shop pattern (1 sheet for sizes 24-36, 1 sheet for sizes 39-45); A0 copy shop pattern (1 sheet for sizes 24-36, 1 sheet for sizes 39-45) // Layers: Yes // Projector file: Yes.'),(100136,44,28,'Family Ada Sweatshirt',10.50,'There are also options for a ribbed neckband or hood, kangaroo pocket, and two lengths (one length for men). This sweatshirt has so many great variations, you\'ll want to make them all! // Sewing level: Confident beginner','Sweatshirt fabric. Ribbing for sleeve cuffs and neckband.','See image gallery.','XS - XL','Ribbing for neckline, sleeve cuffs and hem, 40 cm long x 140 cm wide; cord for hood, 120 cm; two cord stoppers.','Instructions; A4/US letter print-at-home pattern (40 pages for men, 35 pages for women, 30 pages for teens, 25 pages for children); A0 copy shop pattern (1 long sheet for men, 1 long sheet for women, 1 long sheet for teens, 1 sheet for children) // Layers: Yes // Projector file: No.'),(100137,45,25,'Mr London Waistcoat',11.00,'The faux pockets streamline the front and are easy for novice sewists, but if you are up for the challenge and confident they won\'t get stuffed full of used handkerchiefs, why not make them into real pockets? Mr London is a perfect day-to-day waistcoat that\'ll smarten up any outfit.','Mr London enjoys riverside strolls in cottons, tweeds, and woollen fabrics, but is also partial to a brandy or two at the club in velvet or silk. The fabric used for the front of the waistcoat extends slightly round the shoulders to act as a contrasting trim, and looks particularly effective when teamed with vintage style or Liberty print fabrics.','110 cm wide fabric: 1 m + 2 m lining/contrast // 137 cm wide fabric: 1 m + 1.5 m lining/contrast.','XS - XL','Thread; 1 m of iron-on interfacing; 7 buttons.','Instructions; A4 print-at-home pattern; US letter print-at-home pattern; A0 copy shop file.'),(100138,8,33,'Men\'s Longboard T-shirt',8.00,'The pattern also has three sleeve options.','Main fabric: Light/medium weight knit fabric such as cotton/Lycra jersey, rayon/Lycra jersey, bamboo/Lycra jersey. // Neckband: A small amount of cotton/Lycra ribbing. This fabric must have great stretch and return. Alternatively, cotton/Lycra jersey can be used.','The yardage is calculated for directional fabric. If your fabric does not have a directional print you may need less. // Main fabric: 140 cm (55 inch) wide fabric: Short sleeve t-shirt, 110 - 180 cm (1 1/8 - 2 yd) // Full length sleeve t-shirt, 140 - 180 cm (1 1/2 - 2 yd).','XXS - 5XL','','Instructions; A4/legal/letter print-at-home pattern (23 pages); A0 copy shop pattern (2 sheets); projector pattern. This pattern has layers so you can print just the sizes(s) you need.'),(100139,36,1,'Men\'s Finlayson Sweater',10.50,'Theory. This sweater is a grown up version of the classic hoodie. It will be a wardrobe staple due to its cosy boxy shape and hard wearing cuffed hems. // Variation 1 features a unique squared neckline and a stylish shawl collar. It also includes an optional neckline facing that can be used to feature a contrast fabric as a finishing touch to the garment interior. // Variation 2 includes a roomy lined hood that crosses over at the front to join to the squared neckline, as well as a classic kangaroo pocket to protect hands from the elements. // Sewing level: Confident beginner','Medium weight knit fabrics or fleeces. A contrast knit or woven fabric can be used for the decorative neck facing as well as for the hood lining. Stable knits or fleeces without much stretch will work for the body of the sweater but it is best to choose knits with some stretch or ribbing for the cuffs and hem band. There is an optional longer cuff pattern piece provided in case you are working with a fabric without very much stretch.','Variation 1: 115 cm (45 inch) wide fabric (sizes XS-L only): 2.7 m (3.0 yd) // 150 cm (60 inch) wide fabric: 2.3 m (2.5 yd) // Optional decorative facing (if using contrast fabric; otherwise fabric amount is included in self fabric measurements): 0.2 m (0.3 yd). // Variation 2: 115 cm (45 inch) wide fabric: not recommended // 150 cm (60 inch) wide fabric: 2.0 - 2.4 m (2.2 - 2.6 yd) // Optional contrast hood lining (if using contrast fabric; otherwise fabric amount is included in self fabric measurements): 0.6 m (0.7 yd).','XS - XXL','1/2 inch (1.3 cm) (or wider) twill tape to finish the back neckline, stabilise the shoulder seams and finish the kangaroo pocket openings (optional), 0.5 m (0.6 yd).','Step-by-step instructions; US letter/A4 print-at-home pattern (40 pages); 36 inch wide roll feed copy shop pattern (1 sheet); A0 copy shop pattern (3 sheets) // Layers: Yes // Projector file: Yes.'),(100140,1,27,'Men\'s Tee Shirt',12.50,'The T-shirt is probably the world\'s most popular garment, presented here as a smart, contemporary evolution of a wardrobe staple. This tee combines woven fabric with a stretch rib neck. It also features a chest pocket and optional rolled up sleeves.','Self: Laundered linen, linen blends, tencel, tencel/linen, denim, cotton chambray, Indian handweaves, fine wool, needlecord. // Neckband: Ribbing that comfortably stretches by half again.','All with or without nap. // Self: 110 cm (43 1/2 inch) wide fabric: 1.2 - 2.1 m (1 1/2 - 2 1/4 yd) // 120 cm (47 inch) wide fabric: 1.2 - 2.1 m (1 1/2 - 2 1/4 yd) // 140-150 cm (55 inch-60 inch) wide fabric: 1.2 - 1.3 m (1 1/2 yd). // Ribbing: 0.1 m (1/4 yd).','Men\'s 36 - 46. Please check the designer\'s size chart and finished garment measurements. This tee has been designed and cut for men, but can also be worn by women (see image gallery).','','Instructions; A4/US letter print-at-home pattern (20 pages); A0 copy shop pattern (1 sheet).'),(100141,41,13,'Unisex Huy Trousers',13.50,'The interesting pockets at the front and back make them fun to sew. Choose between narrow or wide legs.','A mid-weight cotton, linen or wool fabric is recommended. Be sure to choose a soft fabric, as the gathers of the elastic waistband will look bulky if the fabric is too stiff. Fabrics like twill, tweed, lightweight denim, wool suitings or soft corduroy will work well.','140 cm wide fabric: 1.5 - 2.4 m.','EU 32 - 56 (approx. UK 6 - 28). Please check the designer\'s size chart. Use your hip measurement to find your size. The pattern includes 6 cm ease at the hips.','70-120 cm of 2-3 cm wide elastic.','Instructions; A4 print-at-home pattern (25 pages); A0 copy shop pattern (1 sheet with overlapping pieces) // Layers: No // Projector file: No. // Note: This pattern does not include seam allowances.'),(100142,36,3,'Men\'s Fulford Jeans',10.50,'They feature a conservatively high rise reminiscent of vintage work jeans that sit just below the waist. Sew these jeans in a rugged denim and expect to wear this hard-wearing pair for years to come. // This pattern features all of the traditional details required when sewing denim - add lots of strengthening topstitching, learn to sew flat fell inseams, construct a zipper fly, and apply rivets to high stress areas. As an added bonus, the waistband is drafted in two pieces with a centre back seam hidden under the belt loop. This construction style allows for very easy fit modifications, even once the jeans are fully constructed. This is a perfect solution for the home sewist who might like to sew these as a surprise gift or for the wearer with a fluctuating waistline. // Sewing level: Intermediate / Advanced','Self fabric: Denim fabric (9 - 16 oz.) or bottom-weight fabrics such as twill or corduroy. Fabrics with no stretch or up to 2% elastane (spandex) are suitable. A higher elastane content will change the fit and it may be necessary to size down. Ensure your sewing machine can handle the denim weight you choose by sewing through five layers of the fabric. // Pocket lining: Pocketing, broadcloth or other strong cottons or cotton blends. This is a great opportunity to use novelty printed cottons as it will only be visible from the inside of the jeans!','Sizes 26 - 38: 115 cm (45 inch) wide fabric: 2.6 m (2.9 yd) // 150 cm (60 inch) wide fabric: 1.8 m (2 yd). // Sizes 40 - 50: 115 cm (45 inch) wide fabric: not recommended // 150 cm (60 inch) wide fabric: 2.7 m (3 yd).','Waist 26 inch - 50 inch. Please check the designer\'s size chart and finished garment measurements.','1/2 inch - 1 inch (1.3 - 2.5 cm) diameter metal shank jeans button; 6 pocket rivets; regular polyester thread; topstitching thread in contrast colour; optional 3 inch x 2 1/2 inch (7.6 x 6.4 cm) scrap of leather or washable paper (Kraft-tex) for decorative back label; a metal tooth zipper, 8 inch (20 cm) for sizes 26 - 38 or 9 inch (23 cm) for sizes 40 - 50.','Step-by-step instructions; US letter/A4 print-at-home pattern (28 pages for sizes 26-38, 34 pages for sizes 40-50); 36 inch wide roll feed copy shop pattern (1 sheet for sizes 26-38, 1 sheet for sizes 40-50); A0 copy shop pattern (2 sheets for sizes 26-38, 2 sheets for sizes 40-50); pocket topstitching templates on 6 print-at-home pages // Layers: Yes // Projector file: Yes.'),(100143,36,6,'Men\'s Sayward Raglan T-shirt',10.50,'They explain methods for sewing the shirt with or without a serger. Fabric requirement charts are provided for a monochrome shirt or a colour-blocked shirt with contrast sleeves and neckband. // Sewing level: Confident beginner','Light to medium weight knit fabrics with at least 20% stretch. // Easier to sew: More stable knits such as thick t-shirt knits. Interlock and French terry are good examples of stable knits. Cotton blends with 6% or less spandex content are generally easiest to sew. // More challenging to sew: Very stretchy or thin knits that are prone to curling at their edges. They will still make excellent t-shirts but will be more challenging to sew. Bamboo, cotton or hemp jersey blends, tissue-weight knits, ribbed knits, or athletic materials with a large spandex content are good examples. // Colour block design idea: Use a contrast knit for the neck and sleeves. Consider purchasing two coordinating colours of thread for hemming and topstitching.','Variation 1 Long Sleeves (monochrome): 115 cm (45 inch) wide fabric: 2.4 m (2 3/4 yd) // 150 cm (60 inch) wide fabric: 1.8 m (2 yd). // Variation 1 Long Sleeves (colour block - body): 115 cm (45 inch) wide fabric: 1.5 m (1 3/4 yd) // 150 cm (60 inch) wide fabric: 0.8 m (1 yd). // Variation 1 Long Sleeves (colour block - sleeves): 115 cm (45 inch) wide fabric: 1.0 m (1 1/8 yd) // 150 cm (60 inch) wide fabric: 1.0 m (1 1/8 yd). // Variation 2 Short Sleeves (monochrome): 115 cm (45 inch) wide fabric: 2.0 m (2 1/4 yd) // 150 cm (60 inch) wide fabric: 1.4 m (1 1/2 yd). // Variation 2 Short Sleeves (colour block - body): 115 cm (45 inch) wide fabric: 1.5 m (1 3/4 yd) // 150 cm (60 inch) wide fabric: 0.8 m (1 yd). // Variation 2 Short Sleeves (colour block - sleeves): 115 cm (45 inch) wide fabric: 0.6 m (3/4 yd) // 150 cm (60 inch) wide fabric: 0.6 m (3/4 yd).','XS - 4XL','Thread; stretch or ball point needle; optional twin needle for hems.','Step-by-step instructions; US letter/A4 print-at-home pattern (27 pages); 36 inch wide roll feed copy shop pattern (1 sheet); A0 copy shop pattern (2 sheets) // Layers: Yes // Projector file: Yes.'),(100144,46,8,'Unisex Deauville Shirt',12.00,'Designed to simply pull on, it features a shoulder yoke, a smart one piece collar and easy roll up sleeves. Perfect for a first shirt making project, the Deauville Shirt has a satisfying yet simple construction with lots of scope for adding your own creative details such as interesting fabric combinations, colour blocking, decorative pockets and topstitching.','Go full-on seaside style with a bold vertical cotton stripe or try a more workwear vibe with a light cotton twill. Think blue-jean or opt for a cosy brushed cotton or wool check for full lumberjack style.','115 cm (45 inch) wide fabric: 2.7 m (3 yd) // 140 cm (56 inch) wide fabric: 2.2 m (2 1/2 yd).','A - I (chest 85 - 125 cm / 33 inch - 49 inch). Please check the designer\'s size chart and finished garment measurements.','50 x 40 cm (20 inch x 16 inch) interfacing for the collar (lightweight fusible non-woven interfacing for woven fabrics or stretch interfacing for jersey) // Optional: 2 or 3 shirt buttons or large snaps.','Instructions in A4 and US letter formats; A4 print-at-home pattern (30 pages); US letter print-at-home pattern (28 pages); A0 copy shop pattern (2 sheets). Note: You must print this pattern in colour.'),(100145,47,27,'Men\'s Harold Shirt',10.35,'The look you end up with changes based on how you choose to style it. It can be worn open with a T-shirt underneath or simply buttoned up.','The sample was made using a medium-weight jacquard. A number of different fabrics will work, including denim, cotton twill, corduroy, wool fabrics, etc.','140 cm wide fabric: 160 - 190 cm // 150 cm wide stripe print fabric: 180 - 195 cm.','XS - XL','Thread; 9 buttons, 1.1 cm diameter; iron-on interfacing, max. 70 cm; cotton/lightweight fabric, max. 70 cm.','Step-by-step illustrated instructions; A4/US letter print-at-home pattern (32 pages); A0 copy shop pattern (2 sheets). // Note: Seam allowances are included in this pattern. The copy shop file we print for you shows the cutting lines only (not cutting lines and stitching lines) to make it easier to know what size to cut out.'),(100146,30,9,'Men\'s Shirts M6044',13.50,'It\'s perfect for an intermediate dressmaker. These button front shirts have a collar and collar band, pockets and sleeve variations. A: Short sleeves. A, B, C: Single chest pocket. B, C, D, E: Long sleeves with cuffs. B: Contrast inside collar band and cuffs. D, E: Two chest pockets with flap. E: Front and back yoke.','Lightweight fabrics such as cotton, cotton blends, chambray, silk rayon, washed silk, denim. // Note: Additional fabric may be needed to match stripes, plaids or one-way design fabric.','','M (S','A: Seven 1/2 inch (13 mm) buttons // B, C: Nine 1/2 inch (13 mm) buttons // D, E: Eleven 1/2 inch (13 mm) buttons.',''),(100147,1,37,'Men\'s Elling Trousers',12.50,'An everyday men\'s elasticated trouser with front slanted pockets and back patch pockets. Make them with or without a zip.','5-8 oz. cotton twill or canvas, soft denim, light-medium weight corduroy, linen, hemp/cotton blends, medium weight cotton flannel.','All with or without nap. // 110 cm (43 1/2 inch) wide fabric: 2.5 - 2.8 m (2 3/4 - 3 yd) // 120 cm (47 inch) wide fabric: 2.3 - 2.8 m (2 1/2 - 3 yd) // 140 cm (55 inch) wide fabric: 2.1 - 2.8 m (2 1/4 - 3 yd) // 150 cm (60 inch) wide fabric: 1.6 - 2.8 m (1 3/4 - 3 yd). // The waistband is on the cross grain therefore not on the nap, with the exception of 150 cm (60 inch) wide, sizes 28-32.','Men\'s 28 - 48. Please check the designer\'s size chart and finished garment measurements.','Elastic, 4 cm (1 1/2 inch) wide, 0.9 - 1.3 m (1 - 1 1/2 yd); one 18 cm (7 inch) zip (optional); 0.4 m (1/2 yd) interfacing; 0.4 m (1/2 yd) lining; one 2 cm (3/4 inch) button.','Instructions; A4/US letter print-at-home pattern (30 pages for sizes 28-38, 36 pages for sizes 40-48); A0 copy shop pattern (4 sheets) // Layers: No // Projector file: No.'),(100148,48,33,'113 Unisex Japanese Kimono',14.50,'The pattern also provides extensive notes on history and fabrics, along with traditional and modern ways to wear this garment.','Medium or lightweight cotton, rayon, or silk. Yukata kimono are often blue and white, or, more recently, of other colourful prints.','13 inch-15 inch (33-38 cm) wide fabric: 12 1/2 - 14 1/8 yd (11.44 - 12.92 m) // 28 inch (71 cm) wide fabric: 6 1/2 - 7 1/4 yd (5.95 - 6.64 m) // 36 inch (91 cm) wide fabric: 5 1/8 - 5 5/8 yd (4.7 - 5.15 m) // 45 inch (1.15 m) wide fabric: 4 1/4 - 5 yd (3.89 - 4.58 m). // Fabrics with nap, pile, or one-way design are not suitable for this garment. The traditional tan or kimono bolt (about 14 inch/35.5 cm wide x 12 1/2 yd/11.4 m long) may not be long enough for tall people, although you can make a shoulder yoke from another scrap of fabric.','Sized for men and women up to 6\' tall.','','Instructions; print-at-home pattern (49 pages); 36 inch wide copy shop file; A0 copy shop file.'),(100149,33,24,'Men\'s Shirts S9157',13.00,'It\'s perfect for an advanced beginner/intermediate dressmaker. Men\'s shirts with open pointed collar. Long or short sleeves. Contrast variation.','Cotton Types such as: Poplin, Chambray, Batiks, Linen, Challis, Rayons. // Note: Extra fabric maybe needed to match plaids, stripes, one-way designs fabrics or for shrinkage.','','AA (34 - 42) BB (44 - 52). Please check the size chart and finished garment measurements.','Thread. A: Six 5/8 inch buttons. B,C: Four 5/8 inch buttons.','');
